APPLICATION_TEMPLATES["partial/comments"] = '<div class="panel-heading"> <h3 class="panel-title"> Thread  <span class="badge badge-info" data-bind="text: items().length"> </span> <button class="btn btn-inverse pull-right pad" style="color:white;" data-bind="click:toggleVisibility, text: textForToggle"> </button> </h3> </div> <div class="comments_container widget" data-bind="visible: showComments"> <div class="comments list-group" data-bind="template: { foreach: items }"> <!-- Following must be kept in sync with "partial/comment" --> <div class="list-group-item row-fluid comment-list-item"> <span class="label pull-right" style="margin-right:28px;" data-bind="text: $data.datetime_created_at()"> </span> <div class="row-fluid" style="clear:right;margin-top:25px;margin-left:30px;"> <div class="span1"> <div style="margin-top:8px;" class="row-fluid"> <img class="span6" style:"border:none;" data-bind="attr: { src: $data.user().image_url }"> <span class="span12" data-bind="text: $data.user().username"> </span> </div> </div> <div class="span10 message well" style="position:relative;"> <i class="icon-caret-left icon-large" style="position:absolute; left:-8.5px; top: 19px;"> </i> <p class="list-group-item-text" data-bind="htmlNoScripts: text"> </p> </div> </div> </div> </div> <div class="add_comment row-fluid"> <form data-bind="submit: addElement"> <fieldset> <input id="new-comment-field" type="text" name="text" class="span9 form-control" placeholder="Enter your message"> </input> <button class="btn btn-info span3" type="submit"> <i class="icon-reply"> </i>&nbsp; Send</button> <input type="hidden" name="commented_on_id" data-bind="attr: { value: xelement_id }"> <input type="hidden" name="xelement_id" value="STEPPED-CARE-COACH-CONVO-COMMENTS-GUID"> </fieldset> </form> </div> </div> </div>';
APPLICATION_TEMPLATES["partial/connect_resource_index"] = '<div class="panel panel-green"> <div class="panel-heading"> <h1 class="(%= this.options.resource_type %)"> <i class="icon-quote-left"> </i> (%= this.options.resource_type %) <small>Archive</small> <a href="#summary" class="btn pull-right"> <i class="icon-th-list"> </i> Summary</a> </h1> </div> <div class="list-group"> (% _.each(elements, function(e) { %)  <a href="#" class="list-group-item choose_element" data-cid="(%= e.cid %)">(%= e.html %)</a> (% }); %)  </div> </div>';
APPLICATION_TEMPLATES["partial/header"] = '<div class="navbar navbar-inverse navbar-fixed-top"> <div class="navbar-inner"> <div class="container-fluid"> <button type="button" class="btn btn-navbar" data-toggle="collapse" data-target=".nav-collapse"> <span class="icon-bar"> </span> <span class="icon-bar"> </span> <span class="icon-bar"> </span> </button> <a class="brand cbits" href="#">CBITs</a> <ul class="nav pull-right"> <li> <a href="#modal-contact-us" role="button" data-toggle="modal">Contact a Moderator</a> </li> <li> <a href="#modal-rules" data-toggle="modal">Rules</a> </li> </ul> </div> </div> </div> <div id="modal-contact-us" class="modal hide fade"> <div class="modal-header"> <button type="button" class="close" data-dismiss="modal" aria-hidden="true">&times;</button> <h3>Contact a Moderator</h3> </div> <div class="modal-body"> <p> If there&#39;s a particular issue you would like to contact a moderator about, including any rule breaking by a participant, please use this form to send them a message, and they will respond promptly and appopriately :). </p> <form id="contact-moderator" style="margin-right:20px"> <div class="flash"> </div> <div> <p>Message:</p> <textarea name="message" placeholder="Describe the situation here." style="width:100%;"> </textarea> </div> <div> <p>Does the situation refer to another particular user? If so, include their username</p> <input name="user_concerned" type="text" placeholder="username" /> </div> </form> </div> <div class="modal-footer"> <button class="btn" data-dismiss="modal" aria-hidden="true">Close</button> <button id="send-contact-moderator-form" class="btn btn-primary">Send</button> </div> <script> $("div#modal-contact-us button#send-contact-moderator-form").on("click", app.contactModeratorHandler); </script> </div> <div id="modal-rules" class="modal hide fade"> <div class="modal-header"> <button type="button" class="close" data-dismiss="modal" aria-hidden="true">&times;</button> <h3>Project TECH Rules</h3> </div> <div class="modal-body"> <h2>Why Rules?</h2> <p> Project TECH is composed of people that may have different life experiences and opinions. When voiced in a way that promotes a friendly, safe, and supportive environment, diversity and difference are usually helpful and encouraged. Being respectful of others is key! These Community Guidelines set up expectations for behavior while you are active on the Project TECH website. This is designed to make every user’s experience as safe, productive and enjoyable as possible. </p> <h2>You Must Not...</h2> <ul> <li> <h3>Bully other users</h3> <p> Don&#39;t cause or take part in any behavior that could or is meant to harass, threaten, cause grief, or otherwise abuse your group members or site staff or moderators. Do not be rude. </p> </li> <li> <h3>Use or Share vulgar or harmful language or material</h3> <p> Don&#39;t share or use, or make any jokes including, any content that is sexually explicit, abusive, obscene, hateful, or racially offensive in any format (names, descriptions, images, audio, video, text, etc.) </p> <p> </p> </li> </ul> <h3>Violating these guidelines will lead to removal from Project TECH.</h3> <p>Know that this site is monitored by a trained study staff and we can remove any posting that is inappropriate. If you see anything you think is inappropriate, please use the "Contact A Moderator" to get in contact with us</p> <h2>We encourage you to...</h2> <ul> <li> <h3>Learn together</h3> <p>Get ideas about how to stay healthy, how to deal with difficulties in life, and learn about each other.</p> </li> <li> <h3>Support each other</h3> <p>Be there for your Project TECH friends.</p> </li> <li> <h3>Respect others</h3> <p>Treat others as you would like to be treated.</p> </li> <li> <h3>Use Common Sense</h3> <p>Help remind each other of the rules. No set of rules can address everything; if something doesn&#39;t seem right, a friendly reminder is okay. And you can also always contact us.</p> </li> <li> <h3>Have fun together</h3> <p>We want you to enjoy using Project TECH and interacting with each other - that&#39;s why we made it in the first place!</p> </li> </ul> </p> </div> <div class="modal-footer"> <button class="btn" data-dismiss="modal" aria-hidden="true">Close</button> <button type="button" class="btn btn-primary">Save changes</button> </div> </div>';
APPLICATION_TEMPLATES["partial/mood_graph"] = '<div class="container-fluid"> <div class="row-fluid"> <div class="widget connect-modal span12"> <div class="connect-modal-header"> <h1 class="red"> <i class="icon-dashboard"> </i> Mood</h1> </div> <div class="widget-content"> <div id="mood-graph-container"> </div> <div class="btn-toolbar"> <button id="to-index" class="btn btn-primary btn-large pull-right">Return Home</button> </div> <div class="clearfix"> </div> </div> </div> <!-- widget --> </div> <!-- row-fluid --> </div> <!-- container-fluid -->';
APPLICATION_TEMPLATES["partial/phq9_score"] = '<h3> PHQ-9 Scores </h3> <table class="phq9 table"> <thead> <tr> <td>Date Taken</td> <td>Total Score</td> <td>Q9 Response</td> <td>Checked In?</td> </tr> </thead> <tbody> (%  _.each(scores, function(i) {  var row = t.tr({ class: i.alert },  t.td(i.created_at.toDateString()+" "+i.created_at.toTimeString())+ t.td(i.score.toString())+ t.td(i.PHQ9)+ t.td(i.clinician_checked_in)+ t.td( t.button({class: "certify-checkin", "data-id": i.id}, "Certify Clinician Checked In") ) ); print( row ); }); %) </tbody> </table>';
APPLICATION_TEMPLATES["partial/roadmap_item"] = '<tr class="roadmap-item array-view"> <td class="learn"> <div class="title">(%= item.lessonname %)</div> <div class="summary">(%= item.summary %)</div> </td> <td class="tool"> (%= item.tool %) </td> </tr>';
APPLICATION_TEMPLATES["partial/roadmap_item_old"] = '<div class="day row-fluid"> <div class="span3"> <div class="stream-icon prog-blue-lt"> (%= item.day %) </div> </div> <div class="span4"> <h3>(%= item.lesson_name %)</h3> (%= item.summary %)  </div> <div class="span2"> (%= item.tool %) </div> <div class="span3"> <ul> (% _.each(["activity1","activity2","activity3"], function(attr) { if (item[attr] !== "") { print(t.li(item[attr])); } }); %) </ul> </div> </div> <hr />';
APPLICATION_TEMPLATES["partial/roadmap_week"] = '<h3 class="list-group-item-heading">Week (%= week %)</h3> <div class="well"> <table id="table-entries-(%= week %)" class="table table-condensed table-rounded"> <thead> <tr class="table-head-underline"> <th class="learn span7"> <strong>Learn</strong> </th> <th class="tool span2"> <strong>Practice</strong> </th> </tr> </thead> <tbody id="entries-(%= week %)" class="entries array-view"> </tbody> </table> </div>';
APPLICATION_TEMPLATES["partial/sessions_summary"] = '<h3> Site Usage </h3> <table> <tbody> <tr> <td>This Week&apos;s Logins</td> <td>(%= logins_this_week %)</td> </tr> <tr> <td>Total Logins</td> <td>(%= total_logins %)</td> </tr> <tr> <td>This Week&apos;s Page Views</td> <td>(%= page_views_this_week %)</td> </tr> <tr> <td>Total Page Views</td> <td>(%= total_page_views %)</td> </tr> <tr> <td>This Week&apos;s Page Views / Login</td> <td>(%= (page_views_this_week / logins_this_week) %)</td> </tr> <tr> <td>Total Average Page Views / Login</td> <td>(%= (total_page_views / total_logins) %)</td> </tr> </tbody> </table>';
APPLICATION_TEMPLATES["partial/summary_item"] = '<div class="list-group-item"> <h4 class="list-group-item-heading"> (%= item.user.username %) <span class="label label-default pull-right"> (%= (new Date(item.event.created_at)).toString("h:mm tt on MMM d, yyyy") %) </span> </h4> <p class="list-group-item-text"> (%= item.event.message %) </p> (% if (typeof(item.event.story_route) !== "undefined" && !!item.event.story_route) { %) <a href="#(%= item.event.story_route %)">View <i class="icon-circle-arrow-right"> </i> </a> (% } %)  </div>';
